////////////////////////////////////////////////////////////////////
Portrait generator based on the combinations of AI-Generated faces.
by Karmilla Shelly & fra978
////////////////////////////////////////////////////////////////////
The algorithm uses a combination of 2-4 AI-generated images, selected from a database of 115, to create a unique final mixed composition.
Press "s" to download the PNG file at 5x the current screen resolution, suitable for printing.
Press "i" to show/hide info and the unique generative seed.

